b:make:stone.lua:
function(s, world, area, item)
    if math.random() > 0.7 then
        return area.make_here({
            kind = item.kind("stone-1"),
            name = "Heavy Stone",
            quantity = 1,
        })
    end

    return area.make({
        kind = item.kind("pebble-1"),
        name = "Pebble",
        quantity = 3,
    })
end

